import { Component } from "react";
import { Link } from "react-router-dom";
import { NavList } from "./NavList";
import { NavImages } from "./NavImages";



class NavbarCoureses extends Component{
    render(props){
        return(
            <>
            <nav className="courses">
                <img src="" alt="" />
                <h3></h3>

                {/* menu icons */}
                <div className="menu-icons">
                    <i className=''></i>
                </div>

                {/* nav-links for ug pg mba ca */}
                <div>
                    {NavList.map((item,index) => {
                        return(
                            <div key={index} className="main-card">
                            <div className="">
                            <div>
                                {
                                    NavImages
                                }
                                return(
                                    <img src={props.ug} alt=""/>
                                )

                            </div>
                            <ul>
                                <li><Link href="">{item.title}</Link></li>
                            </ul>
                        </div>
                        </div>
                        )
                    })}

                </div>
            </nav>

            </>
        )
    }
}

export default NavbarCoureses;
